// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

// import "https://github.com/tv-truong/openzeppelin-contracts-4.3.2/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface Energy {
    function balanceOf(address _owner) external view returns (uint256 balance);
    /// @notice transfer '_amount' of VeThor from msg sender to account '_to'
    function transfer(address _to, uint256 _amount) external returns (bool success);
}

// openzeppelin-contracts/v4.3.2
interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    // function permit(address owner, address spender, uint value, uint deadline, uint8 v, bytes32 r, bytes32 s) external;
}

contract TupleTest is ReentrancyGuard {
    struct Input {
        uint256 a;
        uint256 b;
    }
    
    mapping (uint256 => Input) public tupleA;
    uint256 public b;
    uint256 public c;
    //
    Energy constant energy = Energy(0x0000000000000000000000000000456E65726779); // E not e

    // -------------------
    function getErc20Balance(address erc20) public view returns(uint256){
        return IERC20(erc20).balanceOf(address(this));
    }
    function withdrawErc20(address erc20, address recipient, uint256 amount) external {
        IERC20(erc20).transfer(recipient, amount);
    }
    // ------
    function setTuple1(uint256 id, uint256 a, uint256 _b) public {
        tupleA[id] = Input(a, _b);
    }
    function setTuple2(uint256 id, Input memory _input) public {
        tupleA[id] = _input;
    }
    function setTuple3(Input[] memory _inputs) public {
        for (uint i = 0; i < _inputs.length; i++) {
            tupleA[i] = _inputs[i];
        }
    }
    function getTuple1(uint256 id) public view returns(uint256, uint256){
        return (tupleA[id].a, tupleA[id].b);
    }
    function getTuple2(uint256 id) public view returns(Input memory){
        return tupleA[id];
    }
    function getTuple3(uint256[] memory ids) public view returns(Input[] memory k){
        k = new Input[](ids.length);
        for (uint i = 0; i < ids.length; i++) {
            k[i] = tupleA[ids[i]];
        }
    }
    // ------
    function setNonReentrant1(uint256 a) public nonReentrant {
        b += a;
        setNonReentrant2(a);
    }
    function setNonReentrant2(uint256 a) public nonReentrant {
        c += a;
    }
    // -------------------
    
    function set2(uint256 _inputs) public {
        b = _inputs;
    }
    
    function set3(Input memory _inputs) public {
        b = _inputs.a;
    }
    
    function set4(Input memory _inputs) public {
        b = _inputs.b;
    }
    
    //
    function getEnergy() public view returns(uint256 amount){
        return energy.balanceOf(address(this));
    }
    //
    function ownerWithdraw(address payable recipient, uint256 amount) external {
        energy.transfer(recipient, amount);
    }
    function getTimestamp() public view returns (uint256) {
        return block.timestamp;
    }
}
